package bugreports.slowcompare.client;

import com.google.common.base.Objects;
import jetbrains.datapad.js.tests.client.KarmaTest;
import jetbrains.datapad.js.tests.client.KarmaTestSuite;

import java.util.ArrayList;

public class StringTests extends KarmaTestSuite {
  private static final String MODEL = "";

  private static final int N = MODEL.length();

  private static String build(int z) {
    StringBuilder stringBuilder = new StringBuilder();
    for (int i = z; i < N; i++) {
      stringBuilder.append(MODEL.charAt(i));
    }
    return stringBuilder.toString();
  }

  @Override
  protected void registerTests(ArrayList<KarmaTest> tests) {
    tests.add(new KarmaTest("string:comparison:test") {
      @Override
      protected void run() throws Throwable {
        for (int i = 0; i < 10; i++) {
          if (Objects.equal(new Object(), new Object())) {
            throw new IllegalStateException("inconsistent state at 1");
          }
        }
        String build1 = build(0);
        String build2 = build(0);
        long l1 = System.currentTimeMillis();
        if (!Objects.equal(build1, build2)) {
          throw new IllegalStateException("inconsistent state at 2");
        }
        long l2 = (System.currentTimeMillis() - l1);
        if (l2 > 100) {
          throw new IllegalStateException("took too long compare strings of " + N + " chars : "  + l2 + " ms ");
        }
      }
    });
  }
}
